import { connect } from 'react-redux';
import axios from 'axios';
//import PropTypes from "prop-types";

const Table = () => {
	const InvoiceTable = () => {
		axios.get('/api/invoice', res => {
			console.log(res.data);
		});
	};

	return <div>{InvoiceTable()}</div>;
};
Table.prototype = {};

// const mapStateToProps = state => ({
